import {makeAutoObservable} from "mobx";
export default class HouseStore{
    constructor(){
        this._orders =[]
        makeAutoObservable(this);
    }

    setOrders(orders){
        this._orders = orders;
    }

    get orders(){
        return this.orders;
    }
}
